import React from 'react';
import styled from 'styled-components';
import {setFlex, elevation, colors} from '../../utilities';

const SlideFour = ({className}) => {
  return (
    <div className={className}>
      <h3>SLIDE FOUR</h3>
    </div>
  );
}

const SFour = styled(SlideFour)`
  background-image: linear-gradient(to right, #F2B705, ${colors.purple});
  ${setFlex()};
  color: white;
  width: 98%;
  height: 65vh;
  font-size: 4rem;
  margin: 1rem auto;
  border-radius: .7rem;
  ${elevation[5]}
`;

export default SFour;
